// HasMembers applies the HasEdge predicate on the "members" edge.
func HasMembers() predicate.WorkloadResource {
	return predicate.WorkloadResource(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, true, MembersTable, MembersColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasMembersWith applies the HasEdge predicate on the "members" edge with a given conditions (other predicates).
func HasMembersWith(preds ...predicate.WorkloadMember) predicate.WorkloadResource {
	return predicate.WorkloadResource(func(s *sql.Selector) {
		step := newMembersStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.WorkloadResource) predicate.WorkloadResource {
	return predicate.WorkloadResource(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.WorkloadResource) predicate.WorkloadResource {
	return predicate.WorkloadResource(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.WorkloadResource) predicate.WorkloadResource {
	return predicate.WorkloadResource(sql.NotPredicates(p))
}
